v2((data, context) => {
  const hasCdn = data.CdnSourceEdit || data.CdnSourcePublic;
  if (!hasCdn) return false;
  // show the warning if any of the features are not enabled
  const f = context.features;
  if (!f.isEnabled('CdnSourceEdit') || !f.isEnabled('CdnSourcePublic'))
    return true;
  return false;
});
